import React, { useState, useEffect } from 'react';

const GerenciarCategorias = () => {
  const [novaCat, setNovaCat] = useState('');
  const [categoriasSalvas, setCategoriasSalvas] = useState([]);
  const [editandoIndex, setEditandoIndex] = useState(null);
  const [valorEditado, setValorEditado] = useState('');

  useEffect(() => {
    const salvas = JSON.parse(localStorage.getItem('minhasCategorias')) || [];
    setCategoriasSalvas(salvas);
  }, []);

  const salvarCategorias = (novaLista) => {
    setCategoriasSalvas(novaLista);
    localStorage.setItem('minhasCategorias', JSON.stringify(novaLista));
  };

  const adicionar = (e) => {
    e.preventDefault();
    if (!novaCat.trim()) return;
    salvarCategorias([...categoriasSalvas, novaCat]);
    setNovaCat('');
  };

  const excluir = (index) => {
    if (window.confirm("Deseja excluir permanentemente esta categoria?")) {
      const lista = categoriasSalvas.filter((_, i) => i !== index);
      salvarCategorias(lista);
    }
  };

  return (
    <div style={{ padding: '30px', maxWidth: '1000px', margin: '0 auto' }}>
      <div style={{ marginBottom: '40px' }}>
        <h2 style={{ color: 'var(--primary-navy)', fontSize: '28px' }}>üìÇ Gerenciamento Master</h2>
        <p style={{ color: '#64748b' }}>Acesso exclusivo para √Årbitros e Organizadores.</p>
      </div>

      <form onSubmit={adicionar} style={{ display: 'flex', gap: '10px', marginBottom: '40px' }}>
        <input 
          type="text" value={novaCat} onChange={(e) => setNovaCat(e.target.value)}
          placeholder="Nome da nova categoria (Ex: Open Solid√°rio)"
          style={{ flex: 1, padding: '15px', borderRadius: '12px', border: '1px solid #cbd5e1', fontSize: '18px' }}
        />
        <button type="submit" className="btn-sucesso">CRIAR CATEGORIA</button>
      </form>

      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(320px, 1fr))', gap: '20px' }}>
        {categoriasSalvas.map((cat, i) => (
          <div key={i} className="categoria-card">
            {editandoIndex === i ? (
              <input 
                value={valorEditado} 
                onChange={(e) => setValorEditado(e.target.value)}
                style={{ padding: '8px', fontSize: '16px', borderRadius: '5px', border: '1px solid #3b82f6' }}
              />
            ) : (
              <span className="categoria-nome">{cat}</span>
            )}
            
            <div style={{ display: 'flex', gap: '10px' }}>
              {editandoIndex === i ? (
                <button onClick={() => {
                  const n = [...categoriasSalvas]; n[i] = valorEditado;
                  salvarCategorias(n); setEditandoIndex(null);
                }} className="btn-icon" style={{color: 'var(--success)'}}>üíæ</button>
              ) : (
                <button onClick={() => {setEditandoIndex(i); setValorEditado(cat);}} className="btn-icon edit">
                  <svg width="18" height="18" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path d="M11 5H6a2 2 0 00-2 2v11a2 2 0 002 2h11a2 2 0 002-2v-5m-1.414-9.414a2 2 0 112.828 2.828L11.828 15H9v-2.828l8.586-8.586z"></path></svg>
                </button>
              )}
              <button onClick={() => excluir(i)} className="btn-icon delete">
                <svg width="18" height="18" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path d="M19 7l-.867 12.142A2 2 0 0116.138 21H7.862a2 2 0 01-1.995-1.858L5 7m5 4v6m4-6v6m1-10V4a1 1 0 00-1-1h-4a1 1 0 00-1 1v3M4 7h16"></path></svg>
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default GerenciarCategorias;
